import React from 'react';
import BurgerButton from '../../SideNav/BurgerButton';

class Urban extends React.Component {
    render() {
        return (
            <div>
                <BurgerButton />
                <div className="urban-container">
                    <iframe width="560" height="315" src="https://www.youtube.com/embed/WoZQ0ivvW7E?autoplay=1&controls=0&autohide=1"
                        frameborder="0" allow="accelerometer; autoplay; encrypted-media; gyroscope; picture-in-picture"
                        allowfullscreen></iframe>
                    <h3>URBAN</h3>

                </div>
            </div>
        )
    }
}

export default Urban
